import Card from '../UI/Card/Card';
import mProfile from '../../photos/ProfilePic.jpg';
import mmProfile from '../../photos/mursalin.jpg';
import sProfile from '../../photos/shahriar.jpg';
import classes from './AboutUs.module.css';
import Button from '../UI/Button/Button';
import Profile from './profile';
const AboutUs = () => {

  const whoWeAre = (
    <Card className={classes.profile}>
      <Profile name="Md. Abdullah Al Mamun" status="Student, CSE, University of Rajshahi" link="https://www.linkedin.com/in/mamuncseru/"/>
      <div>
        <img src={sProfile} height="192px" width="192px" alt="2" />
        <h1>Md. Al Shahria</h1>
        <p>Student, CSE, University of Rajshahi</p>
        <a href="https://www.linkedin.com/in/mamuncseru/"><Button>LinkedIn</Button></a>
      </div>
      <div>
        <img src={mmProfile} height="192px" width="192px" alt="3" />
        <h1>M.M Mursalin Chowdhury</h1>
        <p>Student, CSE, University of Rajshahi</p>
        <a href="https://www.linkedin.com/in/mamuncseru/"><Button>LinkedIn</Button></a>
      </div>
    </Card>
  );

  return (
    <div className={classes.about}>
      <h1 className={classes.h1}>Who We are?</h1>
      {whoWeAre}
    </div>
  );
};

export default AboutUs;
